import React, { useState } from 'react';
import './Profile.css'; // Import CSS cho trang Profile

const Profile = () => {
    // Gi·∫£ ƒë·ªãnh d·ªØ li·ªáu ng∆∞·ªùi d√πng
    const [userData, setUserData] = useState({
        fullName: 'L√™ ƒê·ª©c To√†n',
        studentId: 'B22DCCN730',
        github: 'https://github.com/ToanVY/IoT.git',
        figma: 'https://www.figma.com/design/R03h45Jnuu58OsxUIhrxlv/IoT?node-id=0-1',
        email: 'letoan5204@gmail.com',
        avatarUrl: 'URL_TO_YOUR_AVATAR_IMAGE' // Thay th·∫ø b·∫±ng URL ·∫£nh ƒë·∫°i di·ªán th·ª±c t·∫ø c·ªßa b·∫°n
    });

    const [isEditing, setIsEditing] = useState(false);

    const handleEditToggle = () => {
        setIsEditing(!isEditing);
        // Khi chuy·ªÉn sang ch·∫ø ƒë·ªô kh√¥ng ch·ªânh s·ª≠a, b·∫°n s·∫Ω g·ªçi API l∆∞u d·ªØ li·ªáu ·ªü ƒë√¢y
        if (isEditing) {
            console.log('D·ªØ li·ªáu ƒë√£ l∆∞u:', userData);
            // call: saveUserData(userData)
        }
    };

    const handleChange = (e) => {
        const { name, value } = e.target;
        setUserData(prevData => ({
            ...prevData,
            [name]: value
        }));
    };

    return (
        <div className="profile-page">
            
            {/* V√πng Header/Card ch√≠nh */}
            <div className="profile-card">
                
                {/* Ph·∫ßn Header Card: ·∫¢nh ƒë·∫°i di·ªán v√† T√™n */}
                <div className="profile-header">
                    <div className="avatar-section">
                        <div className="avatar-placeholder">
                            {/*  */}
                            <img src={userData.avatarUrl} alt="·∫¢nh ƒë·∫°i di·ªán" className="profile-avatar"/>
                        </div>
                        <button className="btn-secondary" onClick={() => console.log('Thay ƒë·ªïi ·∫£nh')}>Thay ƒë·ªïi</button>
                    </div>

                    <div className="info-intro">
                        <h3>{userData.fullName}</h3>
                        <p>{userData.studentId}</p>
                    </div>

                    <button 
                        className="btn-primary" 
                        onClick={handleEditToggle}
                    >
                        {isEditing ? 'L∆∞u' : 'S·ª≠a'}
                    </button>
                </div>

                {/* Ph·∫ßn Form chi ti·∫øt */}
                <div className="profile-details">
                    
                    {/* H·ªå V√Ä T√äN */}
                    <div className="detail-row">
                        <label>H·ªç v√† t√™n</label>
                        <input
                            type="text"
                            name="fullName"
                            value={userData.fullName}
                            onChange={handleChange}
                            readOnly={!isEditing}
                            className={isEditing ? 'editable' : ''}
                        />
                    </div>

                    {/* M√É SV */}
                    <div className="detail-row">
                        <label>M√£ SV</label>
                        <input
                            type="text"
                            name="studentId"
                            value={userData.studentId}
                            onChange={handleChange}
                            readOnly={!isEditing}
                            className={isEditing ? 'editable' : ''}
                        />
                    </div>

                    {/* GITHUB */}
                    <div className="detail-row">
                        <label>Github</label>
                        <input
                            type="text"
                            name="github"
                            value={userData.github}
                            onChange={handleChange}
                            readOnly={!isEditing}
                            className={isEditing ? 'editable' : ''}
                        />
                    </div>
                    
                    {/* FIGMA */}
                    <div className="detail-row">
                        <label>Figma</label>
                        <input
                            type="text"
                            name="figma"
                            value={userData.figma}
                            onChange={handleChange}
                            readOnly={!isEditing}
                            className={isEditing ? 'editable' : ''}
                        />
                    </div>
                    
                    {/* EMAIL */}
                    <div className="detail-row">
                        <label>Email</label>
                        <input
                            type="email"
                            name="email"
                            value={userData.email}
                            onChange={handleChange}
                            readOnly={!isEditing}
                            className={isEditing ? 'editable' : ''}
                        />
                        <span className="email-icon">üìß</span>
                    </div>

                </div>
            </div>
        </div>
    );
};

export default Profile;
